    // פעולות שייעשו בעת לחיצה על כפתור אישור
    // ניתן להשתמש כאן ב-fetch לשליפת הנתונים מ-MongoDB

    const navigation = useNavigation();
    navigation.navigate('SuccessScreen', { message: 'ההתנדבות הושלמה בהצלחה, הפרטים ישלחו בהודעה נפרדת' });
  }

  const handleReject = () => {
    // פעולות שייעשו בעת לחיצה על כפתור דחייה
    // ניתן להשתמש כאן ב-fetch לשליפת הנתונים מ-MongoDB
    setRejection(true);
    
  }

  const fetchData = async () => {
    try {
      // Perform an HTTP request to fetch data from the server
      // const response = await fetch('http://example.com/api/data');
      const response = await fetch('http://localhost:8000/');

      // Parse the response as JSON
      const jsonData = await response.json();

      // Set the retrieved data in the state
      setData(jsonData);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };


  // {!rejection && !checked ? <span>!rejection && !checked</span> : <span>ddd</span>}
  return (
    <>
      {!rejection && !checked ?
        <View style={styles.container}>

          <Text style={styles.message}>{`צריכים ${message.fieldOfVolunteering} מ${message.from} ל${message.where} בשעה ${message.time} יום ${message.day} ${splitdate} `}</Text>

          {/* <Text style={styles.message}>צריכים הסעה מאשדוד הלל 8 לבית החולים אסותא אשדוד בשעה 16:15 יום שלישי 16/02/2023</Text> */}
          <View style={styles.buttonContainer}>
            <TouchableOpacity style={styles.rejectButton} onPress={handleReject}>
              <Text style={styles.buttonText}>דחייה</Text>
              {/* if(rejection==true?<massage />:""); */}
            </TouchableOpacity>
            <TouchableOpacity style={styles.acceptButton} onPress={handleAccept}>
              <Text style={styles.buttonText}>אישור</Text>
            </TouchableOpacity>

          </View>
        </View>
        : rejection ? alert('ok!👍') : <VolunteerComponent />}
      {/* : rejection ? <span>rejection</span> : <span>checked</span>} */}

    </>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#F0F8FF',
    borderRadius: 10,
    padding: 10,
    margin: 10,
    alignItems: 'center'
  },
  message: {
    fontSize: 20,
    fontWeight: 'bold',
    textAlign: 'center',
    color: '#4B0082'
  },
  buttonContainer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    marginTop: 10
  },
  acceptButton: {
    backgroundColor: '#00CED1',
    padding: 10,
    borderRadius: 10,
    width: 120,
    alignItems: 'center'
  },
  rejectButton: {
    backgroundColor: '#FF6347',
    padding: 10,
    borderRadius: 10,
    width: 120,
    alignItems: 'center'
  },
  buttonText: {
    color: '#FFFFFF',
    fontWeight: 'bold',
    fontSize: 16
  }
});

export default HelpMassage;


